import React from 'react'
import { AppBar, makeStyles} from "@material-ui/core";

const useStyles = makeStyles(() => ({
    footer: {
      backgroundColor: "#FF6347",
    },
}));

export default function Footer() {
    return (
        <AppBar className={footer}>
            <Toolbar>ForgeRock</Toolbar>
        </AppBar>
    )
}
